import React from 'react';
import './App.css';
import ComponentA from './components/ComponentA';

const UserContext = React.createContext();

function App() {
  return (
    <div className="App">
      <UserContext.Provider>
      <ComponentA />
      </UserContext.Provider>
    </div>
  );
}

export default App;
